export class AddUserForm extends Component {
    render(){
        return (
            <form>
                <label>
                    Name
                    <input type="text" name="name" />
                </label>

                <label>
                    Email
                    <input type="text" name="email" />
                </label>

                <button type="submit"></button>
            </form>
        )

    }
 }
